    false,nt"url": null,nt"notes": "NODC Accession 0123054 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard the NOAA Ship Thomas Jefferson in the North Atlantic
    Ocean from 2013-03-11 to 2013-03-13. Office of Marine and Aviation Operations (OMAO)
    personnel aboard the ship submitted these data and associated metadata to NODC.
    In addition, NODC Accession 0123054 contains supplementary cruise-level metadata,
    which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC
